import { CST } from "../CST";

export class LevelTwoScene extends Phaser.Scene {
    constructor() {
        super({
            key: CST.SCENES.LEVELTWO,
        });
    }
    init() {}
    preload() {}
    create() {
        this.add
            .image(
                this.game.renderer.width / 2,
                this.game.renderer.height * 0.2,
                "mushroom.png"
            )
            .setDepth(1)
            .setScale(0.5);
        this.add.image(0, 0, "mainbg").setOrigin(0).setDepth(0);
    }
}
